class Solution {
    public long continuousSubarrays(int[] nums) {
        long count = 0; // To store the total number of continuous subarrays
        int left = 0; // Left pointer for the sliding window

        // Iterate through the array with the right pointer
        for (int right = 0; right < nums.length; right++) {
            // Adjust the left pointer to maintain the continuous subarray condition
            for (int i = left; i <= right; i++) {
                if (Math.abs(nums[right] - nums[i]) > 2) {
                    left = i + 1; // Narrow the window from the left side
                }
            }
            // The number of subarrays ending at 'right' is 'right - left + 1'
            count += right - left + 1;
        }

        return count;
    }
}
